description:
Archie Classics - Betty &amp; Veronica Summer Fun v1 (2003) (Forsythe-DCP)

Promotional info - &quot;Blondes, brunettes, beach balls and bikinis- now you can cherish the innocence of summer days gone by with this paperback edition collecting the earliest stories from the hard-to-find BETTY &amp; VERONICA SUMMER FUN editions of the ARCHIE GIANT SERIES! Whether chasing after hunky new lifeguards, modeling the latest swimwear or putting up with Archie and Reggie's goofy rivalry for their affections, Betty and Veronica are truly the queens of summer!&quot;

